import React from 'react';
// import { NavLink } from 'react-router-dom';

import './UserItem.css';


const patientNextOfKinItem = props => (
  <li key={props.userId} className="users__list-item">
    <div>
      <p> Name: {props.name}</p>

    </div>
  </li>
);

export default patientNextOfKinItem;
